import http from "../http-common";

const getAllItemsByBrand = brand => {
    return http.get(`/getAllItemsByBrand?brand=${brand}`);
};
const getItemByAsin = asin => {
    return http.get(`/getItemByAsin/${asin}`);
};

// other CRUD methods

export default {
    getAllItemsByBrand,
    getItemByAsin
};
